commits.content:
import React from "react";
import BannerList from "./BannerList";

const BannerLayout = () => {
  return (
    <section className="product-layout page-container pb-10">
      <h2 className="capitalize text-white mb-10 text-3xl font-bold">
        Sản phẩm
      </h2>
      <BannerList />
    </section>
  );
};

export default BannerLayout;
